pragma solidity ^0.6.6;

contract Birther {

    address core = 0x06012c8cf97BEaD5deAe237070F9587f8E7A266d;

    receive() external payable { }

    function birth(uint256 _kittyId) external {

        (bool success, ) = core.call.value(0)( abi.encodePacked(bytes4(keccak256("giveBirth(uint256)")), _kittyId) );
        if (success) msg.sender.transfer( address(this).balance );

    } 

}
